text:
Resumo do jogo:
40% de culpa do Abraão pelo corte, entregou a bola no pé do artilheiro e não fez ada depois;
60% de culpa do Davi Luís. Aonde que esse cara é zagueiro? Em vez de marcar o cara com a bola, fez foi eixar ele abrir espaço. Todo zagueiro sabe que tem que fechar o ângulo pra não deixar um atacante chutar. Em vez disso, o grande zagueiro internacional ficou dormindo.

